import React, {Component} from 'react';
import Marker from './Marker';

export default class ShelterAPI extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            entries: []
        }
    }
    componentDidMount() {
      this.fetchApiToEntries('https://jsonplaceholder.typicode.com/posts');
    }
    fetchApiToEntries = (apiToFetch) => {
        fetch(apiToFetch)
            .then(result => result.json())
            .then((entries) => {
                this.setState({
                    ...this.state,
                    entries
                })
            })
            .catch((error) => console.log(error));
    }
    render() {
      const {entries} = this.state;
        console.log(entries);
        return (
            <Marker
                        text={entries.address}
                        lat={entries.latitude}
                        lng={entries.lng}
                        />
        )
    }
}
